CREATE TABLE public.customer (
    customer_id integer,
    firstname character varying(50),
    lastname character varying(50),
    suffix character varying(10)
);


CREATE TABLE public.customer_cc (
    creditcardid integer,
    cardtype character varying(50),
    cardnumber character varying(25),
    expmonth smallint,
    expyear smallint,
    customer_id integer,
    cc_first_name character varying(50),
    cc_last_name character varying(50),
    cc_suffix character varying(50)
);

CREATE TABLE public.customer_orders (
    salesorderid integer,
    subtotal numeric,
    accountnumber character varying(50),
    creditcardid integer,
    cust_title character varying(8),
    cust_name character varying(100)
);

